// src/components/FlightList.js
import React from 'react';

const flights = [
  { id: 1, airline: 'IndiGo', from: 'Chennai', to: 'Delhi', price: 4500 },
  { id: 2, airline: 'Air India', from: 'Mumbai', to: 'Bangalore', price: 5300 },
  { id: 3, airline: 'SpiceJet', from: 'Hyderabad', to: 'Kolkata', price: 6100 }
];

function FlightList({ isLoggedIn }) {
  return (
    <div>
      <h2>Available Flights</h2>
      <ul>
        {flights.map((flight) => (
          <li key={flight.id}>
            ✈️ {flight.airline} - {flight.from} to {flight.to} - ₹{flight.price}
            {isLoggedIn && <button style={{ marginLeft: '10px' }}>Book Ticket</button>}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default FlightList;
